import React from "react";
import { Wrapper } from "./styles/Dashboard.styled";
import { Btn } from "../../styles/General.styled";
import Navbar from "../general/Navbar";

const Dashboard = () => {
  return (
    <Wrapper mh="100vh">
      <Navbar />
      <Btn m="3rem 0 0 2rem" bgColor="440A67">
        Click me
      </Btn>
    </Wrapper>
  );
};

export default Dashboard;
